webpackJsonp([0x67c187649113],{516:function(a,n){a.exports={data:{site:{siteMetadata:{title:"Stefanus Hinardi",author:"Stefanus Hinardi"}},markdownRemark:{id:"/Users/stefanusahinardi/Documents/dev/gatsby-blog/src/pages/quotes/index.md absPath of file >>> MarkdownRemark",html:"<p>Here are the collections of quotes that I love the most. I hope some of these can inspire you too</p>\n<ul>\n<li>\n<p>“Your children are not your children. They are the sons and daughters of Life’s longing for itself” ― Kahlil Gibran, The Prophet</p>\n</li>\n<li>\n<p>“You give but little when you give of your possessions.\nIt is when you give of yourself that you truly give.” ― Kahlil Gibran, The Prophet</p>\n</li>\n<li>\n<p>“What I cannot create, I do not understand” - Richard Feynman</p>\n</li>\n</ul>\n<h2>Indonesian</h2>\n<ul>\n<li>\n<p>“Orang boleh pandai setinggi langit, tapi selama ia tidak menulis, ia akan hilang di dalam masyarakat dan dari sejarah. Menulis adalah bekerja untuk keabadian.” - Pramoedya Anata Toer</p>\n</li>\n<li>\n<p>“Kau Pribumi terpelajar! Kalau mereka itu, Pribumi itu, tidak terpelajar, kau harus bikin mereka jadi terpelajar. Kau harus, harus, harus, harus bicara pada mereka , dengan bahasa yang mereka tahu”\n― Pramoedya Ananta Toer</p>\n</li>\n<li>\n<p>“Jangan hanya ya-ya-ya. Tuan terpelajar, bukan yes-man. Kalau tidak sependapat, katakan. Belum tentu kebenaran ada pada pihakku …”\n― Pramoedya Ananta Toer</p>\n</li>\n<li>\n<p>“Lihat, Tuan, keturunan tidak banyak berarti. Kesetian pada negeri dan bangsa ini, Tuan. Ini negeri dan bangsaku; bukan Eropa. Yang Belanda hanya namaku. Tak ada salahnya orang mencintai bangsa dan negeri ini tanpa mesti Pribumi, tanpa berdarah Pribumi” ― Pramoedya Ananta Toer</p>\n</li>\n</ul>",frontmatter:{title:"Quotes",date:"March 16, 2018"}}},pathContext:{slug:"/quotes/",previous:{fields:{slug:"/singapore/"},frontmatter:{title:"Singapore",template:"blog"}},next:{fields:{slug:"/about/"},frontmatter:{title:"About",template:"about"}}}}}});
